lens_1.query:
q = load "${App.Datasets.ERM_Visit_tp.FullyQualifiedName}";
result = group q by ('PlannedVisitStartTime_Year', 'PlannedVisitStartTime_Month','PlannedVisitStartTime_Day');
result = foreach result generate q.'PlannedVisitStartTime_Year' + "~~~" + q.'PlannedVisitStartTime_Month' + "~~~" + q.'PlannedVisitStartTime_Day' as 'PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day', count(q) as 'Daily';
result = group result by 'PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day';
result = foreach result generate 'PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day', first(Daily) as 'Daily', sum(sum(Daily)) over([..0] partition by 'all' order by 'PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day' asc) as 'Cumulative';result = foreach result generate 'PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day', '{{cell(static_1.selection, 0, "value").asString()}}';
result = order result by ('PlannedVisitStartTime_Year~~~PlannedVisitStartTime_Month~~~PlannedVisitStartTime_Day' asc);
result = limit result 2000;
